import { Box, Typography, withStyles } from "@material-ui/core";
import { SkipNextOutlined, SkipPreviousOutlined } from "@material-ui/icons";

interface IProps {
  goToNextQuestion: () => void;
  goToPreviousQuestion: () => void;
}

export default function QuestionBottomBar({
  goToNextQuestion,
  goToPreviousQuestion,
}: IProps) {
  return (
    <Container>
      <Button onClick={goToNextQuestion}>
        <SkipNextOutlined />
        {/* <ButtonText variant="caption" color="inherit">
          Next
        </ButtonText> */}
      </Button>
      <Button onClick={goToPreviousQuestion}>
        <SkipPreviousOutlined />
        {/* <ButtonText variant="caption" color="inherit">
          Prev
        </ButtonText> */}
      </Button>
    </Container>
  );
}

const Container = withStyles({
  root: {
    backgroundColor: "#f0f2f5",
    padding: "0.5rem 1rem",
  },
})(Box);

const Button = withStyles({
  root: {
    float: "right",
    // color: "white",
    // backgroundColor: "#0e62cb",
    margin: "auto 0.2rem",
    borderRadius: 5,
    cursor: "pointer",
    "&:hover": {
      backgroundColor: "#09448e",
    },
  },
})(Box);

const ButtonText = withStyles({
  root: {
    fontWeight: 600,
    textTransform: "capitalize",
  },
})(Typography);
